const Navbar = () => {
    return (
        <nav className="Navbar">
            <h1>Shoping app</h1>
            <div className="links">
                <a href="/">Home</a>
                <a href="/create" style={{
                    color: "white",
                    backgroundClor: '#f1356d',
                    borderRadius: '8px',

                }}>New Order</a>
            </div>
        </nav>
    );
}
 
export default Navbar;
